Lord Hanuman
There was something special about this project from the beginning, I just felt it, the force within all the time while creating the art.

This was one of the most challenging projects for me, the design brief I got was, Lord Hanuman depicting three words — Courage, Devotion and Love. Those 3 words are emotions, not just words which has some  form or physical structure. It was like when you see the art you should feel those emotions and…

I feel I have done a great job here, :) what do you think?
